import { Container, Content, Row } from './styles'
import  Button  from './components/Button';
import  Input  from './components/Input';
const App = () => {
  return (
    <Container>
     <Content>
       <Input />
        <Row>
        <Button label="1"/>
        <Button label="1"/>
        <Button label="3"/>
        <Button label="4"/>

        </Row>
        <Button />
        <Button />
      </Content>
   </Container>

  );
}

export default App;
